import React from 'react';

const Profile = () => {
  return (
    <div className="profile-popup">
      <h2>User Profile</h2>
      <p>This is where the user information would be displayed.</p>
      {/* You can add more user details or links here */}
    </div>
  );
};

export default Profile;
